import React, { useState } from 'react';


import About from './About';
import './sty.css';
import { Routes, Route, Link } from 'react-router-dom';

export default function Navbart() {
 

  return (
    <>
      <div>
        <ul>
          <li><Link to="/About">About</Link></li>
        </ul>
      </div>

      <Routes>
        <Route exact path='/About' element={<About />} />
      </Routes>

      
    </>
  );
}
